/* Animation page settings*/

window.onload = function () {
  var slideItems = document.querySelectorAll(".slide-items"),
    logoAnimate = document.querySelector(".logo-animate"),
    createDiv = document.createElement("div"),
    createSpan = null;
  createDiv.className = "dot-countter";
  logoAnimate.setAttribute("style", "opacity: 1");
  for (var i = 0; i < slideItems.length; i++) {
    slideItems[i]
      .querySelector(".slide-items--text")
      .append(createDiv.cloneNode());
    for (j = 0; j < slideItems.length; j++) {
      createSpan = document.createElement("span");
      if (i == j) {
        createSpan.className = "active";
      }
      slideItems[i]
        .querySelector(".dot-countter")
        .appendChild(createSpan.cloneNode());
    }
  }

  var windowWidth = document.documentElement.clientWidth;

  if (windowWidth > 1024) {
    gsap.registerPlugin(ScrollTrigger);
    var delayTime = 0,
      speed = 100,
      controller = new ScrollMagic.Controller(),
      t1 = gsap.timeline(),
      t2 = gsap.timeline(),
      t3 = gsap.timeline(),
      t4 = gsap.timeline();

    t1.from(".logo-animate", 2, {
      delay: delayTime,
      scale: 0.3,
      y: 0,
      x: 0,
      opacity: 0,
      ease: "none",
      // markers: true
    });
    t1.to(".logo-animate", 2, {
      delay: delayTime,
      scale: 8,
      y: "-110%",
      x: "-112%",
      opacity: 0,
      ease: "none",
    });

    t1.to(".animate-next", 2.5, {
      opacity: 1,
      delay: -1.5,
      scale: 1,
      ease: Power3.easeInOut,
    });

    // Section 2

    var scene = new ScrollMagic.Scene({
      triggerElement: ".section-logo",
      duration: "150%",
      triggerHook: 0,
      // offset: '100'
    })
      .setTween(t1)
      .setPin(".section-logo", {
        pushFollowers: true,
      })
      // .addIndicators(true)
      .addTo(controller);

    // Section 3

    var tl8;
    gsap.utils.toArray(".step-items").forEach(function (item) {
      tl8 = gsap.timeline({
        scrollTrigger: {
          // onEnter: () => { console.log(123); },
          // onLeave: ({progress, direction, isActive}) => console.log(progress, direction, isActive),
          // onUpdate: ({progress, direction, isActive}) => console.log(progress, direction, isActive),
          onSnapComplete: ({ progress, direction, isActive }) =>
            console.log(progress, direction, isActive),
          toggleClass: "active",
          trigger: item,
          start: "top 95%",
          end: "bottom 25%",
          // markers: true,
          scrub: 1.5,
          duration: 5000,
        },
      });
      tl9 = gsap.timeline({
        scrollTrigger: {
          trigger: item.querySelector(".circle-show"),
          start: "top 90%",
          end: "bottom 20%",
          scrub: 1,
        },
      });
      tl9
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 1,
          ease: "none",
        })
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 1,
          ease: "none",
        })
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 0,
          ease: "none",
        });
      tl8
        .to(item, 1, {
          y: 0,
          x: 100,
          opacity: 1,
          scale: 1,
          ease: "none",
        })
        .to(item, 1, {
          y: 0,
          x: 100,
          opacity: 1,
          scale: 1,
          ease: "none",
        })
        .to(item, 1, {
          y: -150,
          x: -300,
          opacity: 0,
          scale: 1,
          ease: "none",
        });
    });

    var slideWraps = document.querySelector(".slider-wrapper");
    var sections = gsap.utils.toArray(".slide-items");
    gsap.to(sections, {
      xPercent: -100 * (sections.length - 1),
      ease: "none",
      duration: 0.5,
      scrollTrigger: {
        trigger: slideWraps,
        pin: true,
        scrub: 1,
        // markers: true,
        end: () => "+=" + slideWraps.offsetWidth,
      },
    });
  } else {
    var tlMob1,
      tlMob2,
      controllerMob = new ScrollMagic.Controller();

    gsap.utils.toArray(".step-items").forEach(function (item) {
      tlMob1 = gsap.timeline({
        scrollTrigger: {
          // onEnter: () => { console.log(123); },
          // onLeave: ({progress, direction, isActive}) => console.log(progress, direction, isActive),
          // onUpdate: ({progress, direction, isActive}) => console.log(progress, direction, isActive),
          // onSnapComplete: ({progress, direction, isActive}) => console.log(progress, direction, isActive),
          toggleClass: "active",
          trigger: item,
          start: "top 95%",
          end: "bottom 15%",
          // markers: true,
          scrub: 1.5,
          duration: 5000,
        },
      });
      tlMob2 = gsap.timeline({
        scrollTrigger: {
          trigger: item.querySelector(".circle-show"),
          start: "top 90%",
          end: "bottom 20%",
          scrub: 1,
        },
      });
      tlMob2
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 1,
          ease: "none",
        })
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 1,
          ease: "none",
        })
        .to(item.querySelector(".circle-show .circle-show--small"), 0.5, {
          opacity: 0,
          ease: "none",
        });
      tlMob1
        .to(item, 1, {
          y: 0,
          x: 0,
          opacity: 1,
          scale: 1,
          ease: "none",
        })
        .to(item, 1, {
          y: 0,
          x: 0,
          opacity: 1,
          scale: 1,
          ease: "none",
        })
        .to(item, 1, {
          y: -150,
          x: -300,
          opacity: 0,
          scale: 1,
          ease: "none",
        });
    });
  }
};

$(function () {
  var slideMobStart = function () {
    if ($(window).width() < 1024) {
      $(".slider-wrapper").slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        dots: false,
        infinite: false,
      });
    }
  };
  slideMobStart();

  var slideMobResize = function () {
    var sliderElement = $(".slider-wrapper");
    if (
      $(window).width() < 1024 &&
      !sliderElement.hasClass(".slick-initialized")
    ) {
      sliderElement.slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        dots: false,
        infinite: false,
      });
    } else if (
      $(window).width() > 1024 &&
      sliderElement.hasClass(".slick-initialized")
    ) {
      sliderElement.slick("unslick");
    }
  };

  $(window).on("resize", function () {
    slideMobResize();
  });
});